import { useState } from "react";
// import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
// import axios from "axios";
import "../css/JobForm.css";
import Swal from 'sweetalert2';
import { Formik, Field } from 'formik';

const JobForm = () => {

        // const URL = 'http://localhost:3001/upload';

        // const [inputs, setInputs] = useState({
        //     title: "",
        //     description: "",
        // });
        const sleep = (ms) => new Promise((r) => setTimeout(r, ms));

        
        // const handleChange = (e) => {
        //     setInputs({
        //     ...inputs,
        //     [e.target.name]: e.target.value,
        //     });
        // };

        // const handleClick = async () => {
        //     await axios.post(URL, inputs);
        //     setInputs({
        //     title: "",
        //     description: "",
        //     });

        Swal.fire({
            title: 'Dato enviado Correctamente',
            text: 'Gracias por enviar sus Datos',
            icon: 'success',
            confirmButtonText: 'Aceptar'
        })

    

return (
    <div>
        <div className="container-fluid">
        <div className="container px-6 py-5" id="custom-cards">
            <h2 className="pb-2 border-bottom">Why us</h2>
            <div className="row row-cols-1 row-cols-lg-3 align-items-stretch g-4 py-5">
            <div className="col">
                <div
                id="card1"
                className="card card-cover h-100 overflow-hidden text-white bg-dark rounded-5 shadow-lg"
                >
                <div className="d-flex flex-column h-100 p-5 pb-3 text-white text-shadow-1">
                    <h2 className="pt-5 mt-5 mb-4 display-6 lh-1 fw-bold">
                    Proof of quality
                    </h2>
                    <ul className="d-flex list-unstyled mt-auto">
                    <li className="me-auto">
                        <img
                        src="https://i.postimg.cc/9Mk72SJn/Dise-o-sin-t-tulo-9.png"
                        alt="Quality"
                        width="32"
                        height="32"
                        className="rounded-circle border border-white"
                        />
                    </li>
                    </ul>
                </div>
                </div>
            </div>

            <div className="col">
                <div
                id="card2"
                className="card card-cover h-100 overflow-hidden text-white bg-dark rounded-5 shadow-lg"
                >
                <div className="d-flex flex-column h-100 p-5 pb-3 text-white text-shadow-1">
                    <h2 className="pt-5 mt-5 mb-4 display-6 lh-1 fw-bold">
                    No cost until you hire
                    </h2>
                    <ul className="d-flex list-unstyled mt-auto">
                    <li className="me-auto">
                        <img
                        src="https://i.postimg.cc/FKspsMVr/Dise-o-sin-t-tulo-10.png"
                        alt="Cost"
                        width="32"
                        height="32"
                        className="rounded-circle border border-white"
                        />
                    </li>
                    </ul>
                </div>
                </div>
            </div>

            <div className="col">
                <div
                id="card3"
                className="card card-cover h-100 overflow-hidden text-white bg-dark rounded-5 shadow-lg"
                >
                <div className="d-flex flex-column h-100 p-5 pb-3 text-shadow-1">
                    <h2 className="pt-5 mt-5 mb-4 display-6 lh-1 fw-bold">
                    Safe and secure
                    </h2>
                    <ul className="d-flex list-unstyled mt-auto">
                    <li className="me-auto">
                        <img
                        src="data:image/png;base64,"
                        alt="Security"
                        width="32"
                        height="32"
                        className="rounded-circle border border-white"
                        />
                    </li>
                    </ul>
                </div>
                </div>
            </div>
            </div>
        </div>

        </div>

            <div className="d-flex flex-column align-items-center">
                    <div>
            <h1>Sign Up</h1>
            <Formik
            initialValues={{
                firstName: '',
                lastName: '',
                email: '',
            }}
            onSubmit={async (values) => {
                await sleep(500);
                alert(JSON.stringify(values, null, 2));
            }}
            >
            {({ isSubmitting }) => (
                <Form>
                <label htmlFor="title">First Name</label>
                <Field name="title" placeholder="Jane" />

                <label htmlFor="description">Last Name</label>
                <Field name="description" placeholder="Doe" />


                <button type="submit" disabled={isSubmitting}>
                    Submit
                </button>
                </Form>
            )}
            </Formik>
        </div>

        {/* {Object.keys(inputs).map((key, index) => (
            <Form.Group className="pt-3" key={index} style={{ maxWidth: "200px" }}>
            <Form.Label id="form">
                {key === ":id" ? key.toUpperCase() : key[0].toUpperCase() + key.slice(1)}</Form.Label>
            <Form.Control
                name={key}
                value={inputs[key]}
                onChange={handleChange}
            />
            </Form.Group>
        ))}
            <Button className="mt-3" onClick={handleClick}>Enviar</Button> */}
        </div>
</div>
);
        }
export default JobForm;
